import './LineList.css';
import Line from './Line.js';
import {useState} from 'react';

function LineList(props) {
    // const [tapLine, setTapLine] = useState(props.initialData[0].key);
    return(
        <div>
            <ul type={"none"}>
        {props.listData.map(data =>
        <Line key={data.key}
              value={data.value}/>)}
            </ul>
        </div>
    )

}




export default LineList;
